import Score from '../Score/Score';
import Intro from '../Intro/Intro';
import Match from '../Match/Match';

import './Main.css';

const Main = () => {
  return (
    <div className="main">
      <Score />
      <Intro />
      <Match />
    </div>
  );
};

export default Main;
